import React from 'react';
import './Home.css'
import { Link } from 'react-router-dom'
import { Container, Card } from 'semantic-ui-react'
import { DB } from '../file/DB.json'

function Home() {
  return (
    <div>
      <Container onDragStart={event => event.preventDefault()}>
        <h1>역사 영상 과제</h1>
        <Card.Group itemsPerRow={2} stackable>
          {
            Object.keys(DB).map(id => (
              <Link to={{
                pathname: `/view/${id}`
              }} key={id}>
                <Card>
                  <Card.Content className='MonthCard'>{id}</Card.Content>
                </Card>
              </Link>
            ))
          }
        </Card.Group>
      </Container>
    </div>
  );
}

export default Home;
